import React, {Component} from 'react';
import { StyleSheet, Text, View} from 'react-native';
import { Button, Row, Container, Col, Nav, Navbar} from 'react-bootstrap';

export class beleuchtung extends Component {
    render() {
        return (

          <View> 
          <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#home">SmartHome</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#beleuchtung">Beleuchtung</Nav.Link>
            </Nav>
          </Navbar.Collapse>
          </Navbar>
          <Container fluid>
          <Row>
           <Col><Text style={styles.title}>Amini zik zok</Text></Col>
          </Row>
           <Row>
            <Button variant="primary">Primary</Button>
            <Button variant="outline-primary">Primary</Button>
            <Button variant="outline-danger">Danger</Button>
            <Button variant="outline-success">Success</Button>
          </Row>
          </Container> 
          </View>
        );
      }
}

//Styles f√ºr aussehen
const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },

    title: {
      marginTop: 16,
      paddingVertical: 8,
      color: "#20232a",
      textAlign: "center",
      fontSize: 30,
      fontWeight: "bold"
    }


  });
